CREATE TABLE rbmc
(
    id integer NOT NULL,
    geom geometry(MultiPointZ,4326),
    name character varying(254) COLLATE pg_catalog."default",
    CONSTRAINT "RBMC_pkey" PRIMARY KEY (id)
)

TABLESPACE pg_default;

CREATE INDEX "sidx_RBMC_geom"
    ON rbmc USING gist
    (geom)
    TABLESPACE pg_default;

